// import Header from './components/Header';
import Home from './components/Home';
import About from './components/About';
import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';

import './App.css';

function App() {
  return (
    <Router>
        <div className="App">
        <Link to="/">
          Home
        </Link>
        <Link to="/about">
          About
        </Link>
        <Link to="/portfolio">
          Portfolio
        </Link>
        <Link to="/resume">
          Resume
        </Link>
        <Link to="/contact">
          Contact
        </Link>
        </div>

      <Switch>
        <Route path="/" exact>
          <Home />
        </Route>
        <Route path="/about" exact>
          <About />
        </Route>


      </Switch>




    </Router>
  );
}

export default App;
